import L from 'leaflet';
import '../../styles.css';

const iconWidth = 40;
const iconHeight = 40;

var iconTractorX = L.Icon.extend({
    options: {
        iconUrl: require('../../images/tractor.jpg'),
        iconRetinaUrl: require('../../images/tractor.jpg'),
        iconAnchor: [12, 41],
        popupAnchor: null,
        shadowUrl: null,
        shadowSize: [41, 41],
        shadowAnchor: null,
        iconSize: new L.Point(iconWidth, iconHeight),
        className: 'leaflet-div-icon'
    }
});

const iconTractor =  iconTractorX({
    iconUrl: require('../../images/tractor.jpg'),
    iconRetinaUrl: require('../../images/tractor.jpg'),
    iconAnchor: [12, 41],
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: [41, 41],
    shadowAnchor: null,
    iconSize: new L.Point(iconWidth, iconHeight),
    className: 'leaflet-div-icon'
});

const iconDrone = new L.Icon({
    iconUrl: require('../../images/drone.png'),
    iconRetinaUrl: require('../../images/drone.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(iconWidth, iconHeight),
    className: 'leaflet-div-icon'
});

export { iconTractor, iconDrone };
